{"attributes":{"args":{"ohlc_range":{"id":"1198371"},"source":{"id":"1198401"},"volume_range":{"id":"1198608"}},"code":"if (!window._bt_scale_range) {\n    window._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1198789","type":"CustomJS"},{"attributes":{"data":{"Close":{"__ndarray__":"PQrXo3BdVEAK16NwPQpUQM3MzMzM/FNAUrgeheuBVEB7FK5H4VpUQB+F61G4rlRAXI/C9ShsVEBcj8L1KMxUQK5H4XoUrlRA7FG4HoXbVEDD9Shcj/JUQMP1KFyP4lVAw/UoXI8CVkD2KFyPwpVWQLgehetRWFZAXI/C9Sg8VkBI4XoUrldWQKRwPQrXM1ZArkfhehQuVkDXo3A9CudVQPYoXI/CJVZArkfhehR+VkC4HoXrUchWQIXrUbgeBVdAj8L1KFxfV0CF61G4HnVXQKRwPQrXQ1dA7FG4HoVLV0Bcj8L1KExXQBSuR+F6pFdAmpmZmZmJV0Bcj8L1KMxXQDMzMzMzo1hArkfhehReWEAK16NwPSpYQAAAAAAAQFhA9ihcj8JVWEDXo3A9CjdYQEjhehSul1hAcT0K16NgWEAK16NwPfpYQKRwPQrXw1hA4XoUrkcBWUD2KFyPwmVZQLgehetReFlAXI/C9SisWUDD9Shcj7JZQK5H4XoUvllAUrgehetBWUBxPQrXo4BZQK5H4XoUnllAZmZm
